      out.write("}\r\n");
      out.write("function checkORGRight1(obj){//校验组织机构代码\r\n");
      out.write("\t   var code=obj.value;\r\n");
      out.write("\t   if(code.length>0){\r\n");
      out.write("    code=code.substring(0,1);\r\n");
      out.write("    if(code==\"X\"){return true;\r\n");
      out.write("     }\r\n");
      out.write("\t   }\r\n");
      out.write("\t   var financecode=obj.value;\r\n");
      out.write("\t   var fir_value, sec_value;\r\n");
      out.write("\t   var w_i = new Array(8);\r\n");
      out.write("\t   var c_i = new Array(8);\r\n");
      out.write("\t   var j, s = 0;\r\n");
      out.write("\t   var c, i;\r\n");
      out.write("\r\n");
      out.write("\t   var code = financecode;\r\n");
      out.write("\r\n");
