      out.write("\t   if (code == \"00000000-0\") {\r\n");
      out.write("\t\t   mini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t       return false;\r\n");
      out.write("\t   }\r\n");
      out.write("\r\n");
      out.write("\t   re = /[A-Z0-9]{8}-[A-Z0-9]/;    \r\n");
      out.write("\t   r = code.match(re);   \r\n");
      out.write("\t   if (r == null) {\r\n");
      out.write("\t\t   mini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t     return false;\r\n");
      out.write("\t   }        \r\n");
      out.write("\r\n");
      out.write("\t\t   w_i[0] = 3;\r\n");
      out.write("\t\t   w_i[1] = 7;\r\n");
      out.write("\t\t   w_i[2] = 9;\r\n");
      out.write("\t\t   w_i[3] = 10;\r\n");
      out.write("\t\t   w_i[4] = 5;\r\n");
      out.write("\t\t   w_i[5] = 8;\r\n");
      out.write("\t\t   w_i[6] = 4;\r\n");
