      out.write("\r\n");
      out.write("\t\t   if (financecode.charAt(8) != '-') {\r\n");
      out.write("\t\t\t   mini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t\t\t   return false;\r\n");
      out.write("\t\t   }\r\n");
      out.write("\r\n");
      out.write("\t\t   for (i = 0; i < 10; i++) {\r\n");
      out.write("\t\t\t   c = financecode.charAt(i);\r\n");
      out.write("\t\t\t   if ((c <= 'z') && (c >= 'a')) \r\n");
      out.write("\t\t\t  {\r\n");
      out.write("\t\t\t\t   mini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t\t\t\t   return false;\r\n");
      out.write("\t\t\t   }\r\n");
      out.write("\t\t   }\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("\t\t   fir_value = financecode.charCodeAt(0);\r\n");
      out.write("\t\t   sec_value = financecode.charCodeAt(1);\r\n");
      out.write("\r\n");
      out.write("\t\t   if (fir_value >= 'A'.charCodeAt(0) && fir_value <= 'Z'.charCodeAt(0)) {\r\n");
      out.write("\t\t\t   c_i[0] = fir_value + 32 - 87;\r\n");
      out.write("\t\t   } else {\r\n");
      out.write("\t\t\t\tif (fir_value >= '0'.charCodeAt(0) && fir_value <= '9'.charCodeAt(0)) {\r\n");
      out.write("\t\t\t\tc_i[0] = fir_value - '0'.charCodeAt(0);\r\n");
      out.write("\t\t\t\t} else {\r\n");
      out.write("\t\t\t\t\tmini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t   }\r\n");
      out.write("\r\n");
      out.write("\t\t   s = s + w_i[0] * c_i[0];\r\n");
      out.write("\r\n");
      out.write("\t\t   if (sec_value >= 'A'.charCodeAt(0) && sec_value <= 'Z'.charCodeAt(0)) {\r\n");
      out.write("\t\t\t   c_i[1] = sec_value + 32 - 87;\r\n");
      out.write("\t\t   } else if (sec_value >= '0'.charCodeAt(0) && sec_value <= '9'.charCodeAt(0)) {\r\n");
      out.write("\t\t\t   c_i[1] = sec_value - '0'.charCodeAt(0);\r\n");
      out.write("\t\t   } else {\r\n");
      out.write("\t\t\t   mini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t\t\t   return false;\r\n");
      out.write("\t\t   }\r\n");
      out.write("\r\n");
      out.write("\t\t   s = s + w_i[1] * c_i[1];\r\n");
      out.write("\t\t   for (j = 2; j < 8; j++) {\r\n");
      out.write("\t\t\t   if (financecode.charAt(j) < '0' || financecode.charAt(j) > '9') {\r\n");
      out.write("\t\t\t   alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t\t\t\t   return false;\r\n");
      out.write("\t\t\t   }\r\n");
      out.write("\t\t\t   c_i[j] = financecode.charCodeAt(j) - '0'.charCodeAt(0);\r\n");
      out.write("\t\t\t   s = s + w_i[j] * c_i[j];\r\n");
      out.write("\t\t   }\r\n");
      out.write("\r\n");
      out.write("\t\t   c = 11 - (s % 11);\r\n");
      out.write("\r\n");
      out.write("\t\t   if (!((financecode.charAt(9) == 'X' && c == 10) ||\r\n");
      out.write("\t\t\t\t (c == 11 && financecode.charAt(9) == '0') || (c == financecode.charCodeAt(9) - '0'.charCodeAt(0)))) {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t  mini.alert(\"组织机构代码/社会信用代码错误!\");\r\n");
      out.write("\t\t\t\t\treturn false;\r\n");
      out.write("\t\t   }\r\n");
      out.write("\t   return true;\r\n");
      out.write("}\r\n");
      out.write("function isValidBusinessLicense(code){\r\n");
      out.write("\tvar businessCodeReg = /^\\d{15}$/g;\r\n");
      out.write("\tif(!businessCodeReg.test(code)){\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\t}\r\n");
      out.write("\tvar s = [];\r\n");
      out.write("\tvar p = [];\r\n");
      out.write("\tvar a = [];\r\n");
      out.write("\tvar m = 10;\r\n");
      out.write("\tp[0] = m;\r\n");
      out.write("\tfor(var i = 0 ; i < code.length;i++){\r\n");
      out.write("\t\ta[i] = parseInt(code.substring(i,i+1),m);\r\n");
      out.write("\t\ts[i] = (p[i]%(m+1)) + a[i];\r\n");
      out.write("\t\tif(0 == s[i] % m){\r\n");
      out.write("\t\t\tp[i+1] = 10 *2;\r\n");
      out.write("\t\t}else {\r\n");
      out.write("\t\t\tp[i+1] = (s[i]%m)*2;\r\n");
      out.write("\t\t}\r\n");
      out.write("\t}\r\n");
      out.write("\tif(s[14]%m == 1){//校验位的合法性\r\n");
      out.write("\t\t//合法\r\n");
      out.write("\t\treturn true;\r\n");
      out.write("\t}else{\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\t}\r\n");
      out.write("}\r\n");
      out.write("function isValidEntpCode(code)\r\n");
      out.write("{\r\n");
      out.write("    var ws = [3,7,9,10,5,8,4,2];\r\n");
      out.write("    var  str = \"0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ\";\r\n");
      out.write("    var  rx = /^([0-9A-Z]){8}-[0-9|X]$/g;\r\n");
      out.write("    if (!rx.test(code)){return false;}\r\n");
      out.write("     var  sum = 0;\r\n");
      out.write("    for (var i = 0; i < 8; i++)\r\n");
      out.write("    {sum += str.indexOf((code.substr(i,1))+\"\") * ws[i];}\r\n");
      out.write("    var  c9 = 11 - (sum % 11);\r\n");
      out.write("    var  sc9 =c9+\"\";\r\n");
      out.write("    if (11 == c9)\r\n");
      out.write("    {sc9 = \"0\";}\r\n");
      out.write("    else if (10 == c9)\r\n");
      out.write("    {   sc9 = \"X\";}\r\n");
      out.write("    return sc9==(code.substr(9,1));\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("// 验证社会信用代码 18位\r\n");
      out.write("function isValidSocialCreditIdentifier(code) {\r\n");
      out.write("\tdebugger;\r\n");
      out.write("\tif (code.length != 18)\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\tvar ws = [1, 3, 9, 27, 19, 26, 16, 17, 20, 29, 25, 13, 8, 24, 10, 30, 28];\r\n");
      out.write("\tvar str = \"0123456789ABCDEFGHJKLMNPQRTUWXY\";\r\n");
      out.write("\t//验证9-17位 的组织机构代码\r\n");
      out.write("\tvar tCode = code.substr(8, 8) + \"-\" + code.substr(16, 1);\r\n");
      out.write("\tif (isValidEntpCode(tCode) == false)\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\tvar sum = 0;\r\n");
      out.write("\tfor (var i = 0; i < 17; i++) {\r\n");
      out.write("\t\tsum += str.indexOf((code.substr(i, 1)) + \"\") * ws[i];\r\n");
      out.write("\t}\r\n");
      out.write("\tvar c18 = 31 - (sum%31);\r\n");
      out.write("\tif(c18 > 30){\r\n");
      out.write("\t\tc18 = 0;\r\n");
      out.write("\t} \r\n");
      out.write("\treturn (str.substr(c18, 1) + \"\") == (code.substr(17, 1));\r\n");
      out.write("}\r\n");
      out.write("\r\n");
